import React from 'react';
import Card from './Card';
import {robots} from './robots';

const CardList = () => {
	const listOfCards = [];
	for (let i = 0; i < robots.length; i++){
		listOfCards.push(<Card key={robots[i].id} name={robots[i].name} email={robots[i].email} />)
		}
	return (
		<div>
			{listOfCards}
		</div>
		)
	}


export default CardList;
